import './SiteMenu.css';
import styled from 'styled-components';
import React from "react";

const SiteMenuStyled = styled.div`
  min-width: 290px;
  border-right: 2px solid #f7f7f7;
  display: flex;
  flex-direction: column;
`;

export const SiteMenu: React.FunctionComponent = (props) => (
  <SiteMenuStyled>
    {props.children}
  </SiteMenuStyled>
);
